	USER_AGENT[5313]='Mozilla/5.0 (X11; U; Linux x86_64; en-ca) AppleWebKit/531.2+ (KHTML, like Gecko) Version/5.0 Safari/531.2+'
	USER_AGENT[5314]='Mozilla/5.0 (X11; U; Linux x86_64; en-GB; rv:1.9.2.13) Gecko/20101206 Red Hat/3.6-2.el5 Firefox/3.6.13'
	USER_AGENT[5315]='Mozilla/5.0 (X11; U; Linux x86_64; en-US) AppleWebKit/537.36 (KHTML, like Gecko)  Chrome/30.0.1599.114 Safari/537.36 Puffin/4.5.0IT'

	#--------------------------------------------------------------------- Selection process
	# Random 0-1999
	ACCEPT=${ACCEPT[$(shuf -i 0-1999 -n 1)]}

	# Favored towards 0-8 rather than 0-14
	if [[ $RANDOM -gt 10000 ]]; then
		ENCODING=${ENCODING[$(shuf -i 0-8 -n 1)]}
	else
		ENCODING=${ENCODING[$(shuf -i 0-14 -n 1)]}
	fi

	# Heavily favored towards English
	if [[ $RANDOM -gt 20000 ]]; then
		LANGUAGE=$(shuf -i 5-9 -n 1)
		LANGUAGE="en-US,en;q=0.${LANGUAGE}"
	elif [[ $RANDOM -gt 10000 ]]; then
		LANGUAGE='en-US'
	elif [[ $RANDOM -gt 7500 ]]; then
		LANGUAGE='en'
	else
		LANGUAGE=${LANGUAGE[$(shuf -i 0-229 -n 1)]}
	fi

	# Random 0-4
	REFERER=${REFERER[$(shuf -i 0-4 -n 1)]}

	# Around 75% chance to be turned on
	[[ $RANDOM -gt 10000 ]] && DNT=1 || DNT=0

	# Random 20 4 3
	SEC_FETCH_DEST=${SEC_FETCH_DEST[$(shuf -i 0-20 -n 1)]}
	SEC_FETCH_MODE=${SEC_FETCH_MODE[$(shuf -i 0-4 -n 1)]}
	SEC_FETCH_SIDE=${SEC_FETCH_SIDE[$(shuf -i 0-3 -n 1)]}
	USER_AGENT=${USER_AGENT[$(shuf -i 0-5315 -n 1)]}

	# Print headers if [HTTP_HEADERS_VERBOSE] is on
	if [[ $HTTP_HEADERS_VERBOSE = true ]]; then
		printf "${BYELLOW}%s${OFF}\n" "--- HTTP Headers ---"
		printf "%s\n" \
			"ACCEPT         | $ACCEPT"         \
			"ENCODING       | $ENCODING"       \
			"LANGUAGE       | $LANGUAGE"       \
			"REFERER        | $REFERER"        \
			"DNT            | $DNT"            \
			"SEC_FETCH_DEST | $SEC_FETCH_DEST" \
			"SEC_FETCH_MODE | $SEC_FETCH_MODE" \
			"SEC_FETCH_SITE | $SEC_FETCH_SITE" \
			"USER_AGENT     | $USER_AGENT"     \
			""
	fi
	declare -ag WGET_HTTP_HEADERS
	WGET_HTTP_HEADERS+=("--header=Accept: $ACCEPT") || exit 1
	WGET_HTTP_HEADERS+=("--header=Accept-Encoding: $ENCODING") || exit 2
	WGET_HTTP_HEADERS+=("--header=Accept-Language: $LANGUAGE") || exit 3
	WGET_HTTP_HEADERS+=("--header=Referer: $REFERER") || exit 4
	WGET_HTTP_HEADERS+=("--header=DNT: $DNT") || exit 5
	WGET_HTTP_HEADERS+=("--header=Sec-Fetch-Dest: $SEC_FETCH_DEST") || exit 6
	WGET_HTTP_HEADERS+=("--header=Sec-Fetch-Mode: $SEC_FETCH_MODE") || exit 7
	WGET_HTTP_HEADERS+=("--header=Sec-Fetch-Site: $SEC_FETCH_SITE") || exit 8
	WGET_HTTP_HEADERS+=("--header=User-Agent: $USER_AGENT") || exit 9
}
